import React, { useState } from 'react';
import './header.scss';

export default function Header() {

    let [scrolling, setScrolling] = useState(false);




    return (
        <div className="header d-flex justify-content-center align-items-center">
            <div className="header-side d-flex justify-content-end align-items-center">
                <div className="header-item mr-3">About Me</div>
                <div className="header-item mr-3">Projects</div>
            </div>
            <div className="header-middle d-flex justify-content-center align-items-center">
                <img src="./catheadlogo.png" alt="headlogo" className="header-logo-expanded" />
            </div>
            <div className="header-side d-flex justify-content-right align-items-center">
                <div className="header-item ml-3">Games</div>
                <div className="header-item ml-3">Contact Me</div>
            </div>
        </div>
    );
}
